import styles from './PlayQuiz.module.css'
import Button from '../UI/Button/Button'
import Input from '../UI/Input/Input';
import Question from "../Questions/Questions"

let PlayQuiz = (props) => {
    return(
            <div className={styles["game-panel"]}>
                <Questions></Questions>
                <div className={styles.uname}>Abhishek</div>
                <div id='status' className={styles.status}>
                <div className={styles.questionLeft}>Total : 10</div>
                <div className={styles.score}>Correct: 5</div>
                <div className={styles.left}>Left: 5</div>
                </div>
            </div>  
    )
}

export default PlayQuiz;
